import React from "react";
import ReactDOM from "react-dom";
import "./App.css";

function Header() {
  return (
    <header>
      <h1>Frigus</h1>
    </header>
  );
}

function Main() {
  return (
    <>
      <product>
        <h1>Manage me!</h1>
      </product>

      <recipes>
        <h1>Cook me!</h1>
      </recipes>
    </>
  );
}

function Footer(props) {
  return (
    <footer>
      <h1>Copyright {props.year} </h1>
      <h1>Contact info</h1>
    </footer>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <Main />
      <Footer year={new Date().getFullYear()} />
    </div>
  );
}

const container = [
  <ul>
    <sectiontitle>
      <h1>My Fridge</h1>
    </sectiontitle>
    <section1>
      <h1>Top shelf</h1>
    </section1>
    <section2>
      <h1>Middle shelf</h1>
    </section2>
    <section3>
      <h1>Lower shelf</h1>
    </section3>
  </ul>,
];

export default App;
